Chordizer.A=function(b,a){this.addChord(b,"A",0,a).addMute("LowE").addOpenString(["A","HighE"]).addFretPress(2,["D","G","H"])};Chordizer.Am=function(b,a){this.addChord(b,"Am",0,a).addMute("LowE").addOpenString(["A","HighE"]).addFretPress(1,"H").addFretPress(2,["D","G"])};Chordizer.Am_G=function(b,a){this.addChord(b,"Am/G",0,a).addMute("A").addOpenString(["G","HighE"]).addFretPress(1,"H").addFretPress(2,["D"]).addFretPress(3,"LowE")};Chordizer.Am7=function(b,a){this.addChord(b,"Am7",0,a).addMute("LowE").addOpenString(["A","G","HighE"]).addFretPress(2,"D").addFretPress(1,["H"])};Chordizer.B=function(b,a){this.addChord(b,"B",1,a).addMute("LowE").addBarre(1,"A","HighE").addFretPress(3,["D","G","H"])};Chordizer.Bm=function(b,a){this.addChord(b,"Bm",1,a).addMute("LowE").addBarre(1,"A","HighE").addFretPress(2,"H").addFretPress(3,["D","G"])};